import React from 'react'

export default class Logout extends React.Component {
    constructor() {
        super()        
    }

    componentDidMount() {
        console.log('In Logout page')
        Axios.post('/users/logout')
        .then(response => {
            console.log(response.data)     
            this.props.history.push('/')
        })
        .catch(err => {
            console.log(err)
        })
    }
}
